  true,\n\t\"url\": null,\n\t\"notes\": \"Dept of Interior - System. The Federal Personnel/Payroll
  System is a mainframe-based, portable, integrated, on-line, and real-time personnel
  and payroll system developed and operated by the Department of Interioru2019s National
  Business Center (NBC). The system provides personnel and payroll support to numerous
  agencies. The system is customer-driven, creating and generating the full life cycle
  of personnel transactions, enabling agencies to maintain records electronically.
  FPPS handles all current regulations including specialized pay, garnishments, special
  appointment programs, and more.DOT is undergoing a complete migration from CPMIS
  and CUPS to FPPS.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
